import React from 'react'
import Navbar from '../Ui/Navbar'
import CompaniesTable from './CompaniesTable'
// import { Link } from 'react-router-dom'
import { useNavigate } from 'react-router-dom'
function Companies() {
  const navigate = us
  const handleCrateCompany =()=>{
    navigate("/admin/createcompany");
  }
  return (
    <div className='pt-4'>
      <Navbar />
      <div>
        <div className='bg-secondary my-3 py-3 px-5 mx-auto container d-flex justify-content-between'>
          <input placeholder='Filter by company name' className='w-25 px-3' />
          <button className='btn btn-sm text-dark bg-info' onClick={handleCrateCompany}>New Company</button>
        </div>
        <CompaniesTable />
      </div>
    </div>
  )
}

export default Companies
